import React, { Component } from 'react'
import { View,Text, Image, SafeAreaView } from 'react-native';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import { NavigationContainer } from '@react-navigation/native';
import FCWineries from './FunctionalComponents/FCWineries';
import FCWines from './FunctionalComponents/FCWines';
import logo from './assets/logoArvino.png';

const Tab = createMaterialBottomTabNavigator();

function MaterialTabPage() {

  function HomeScreen() {
    return (
      <View style={styleSheet.container}>
        <Image
          source={logo}
          style={styleSheet.logo}
        />
      <FCWineries />
      <FCWines />
      </View>
    );
  }

  function GroupsScreen() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Settings!</Text>
      </View>
    );
  }

  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Home" component={HomeScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="home" size={26} />
            ),
          }} />
        <Tab.Screen name="Groups" component={GroupsScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="group" size={26} />
            ),
          }} />
      </Tab.Navigator>
    </NavigationContainer>
  )

}
export default MaterialTabPage;
